import { useState } from "react";
import { Card, CardContent } from "@/components/ui/card";
import { Button } from "@/components/ui/button";
// import Button from "../components/ui/button";
// import { Card, CardContent } from "../components/ui/card";

export default function DashboardContent({ selectedOrder }) {
  const [selectedOption, setSelectedOption] = useState("");

  if (selectedOrder === "spot") {
    return (
      <div className="mt-6 grid grid-cols-2 gap-6">
        <Card className="bg-gray-900 p-4 cursor-pointer" onClick={() => setSelectedOption("create")}>
          <CardContent><p className="text-lg font-bold">Create Order</p></CardContent>
        </Card>
        <Card className="bg-gray-900 p-4 cursor-pointer" onClick={() => setSelectedOption("modify")}>
          <CardContent><p className="text-lg font-bold">Modify Order</p></CardContent>
        </Card>
        <Card className="bg-gray-900 p-4 cursor-pointer" onClick={() => setSelectedOption("cancel")}>
          <CardContent><p className="text-lg font-bold">Cancel Order</p></CardContent>
        </Card>
        <Card className="bg-gray-900 p-4 cursor-pointer" onClick={() => setSelectedOption("pnl")}>
          <CardContent><p className="text-lg font-bold">PNL Report & Order Sell</p></CardContent>
        </Card>
      </div>
    );
  }

  return (
    <div className="mt-6 grid grid-cols-3 gap-6">
      <Card className="bg-gray-900 p-4">
        <CardContent>
          <p className="text-lg font-bold">Your Verification is Completed</p>
          <p className="text-green-400 mt-2">✔ Completed</p>
        </CardContent>
      </Card>
      <Card className="bg-gray-900 p-4 border border-yellow-500">
        <CardContent className="flex flex-col gap-3">
          <p className="text-lg font-bold">Complete a Deposit to Start Your Trading Journey on Binance</p>
          <Button className="bg-yellow-400 text-black">Deposit</Button>
        </CardContent>
      </Card>
      <Card className="bg-gray-900 p-4">
        <CardContent>
          <p className="text-lg font-bold">Trade</p>
          <p className="text-gray-400 mt-2">⏳ Pending</p>
        </CardContent>
      </Card>
    </div>
  );
}
